      class << self
        def flush_rates
          data = {}
          path =  Pathname.new(__FILE__).dirname
          
          workbook = Roo::Spreadsheet.open "#{path}/rates.xlsx"
          worksheets = workbook.sheets          
          sheet_1 = worksheets[0]
                            
          countries =  workbook.sheet(sheet_1).row(4)
          lbs_weight_rows_range = 6..71

          lbs_weight_rows_range.each do |row|
            fees = workbook.sheet(sheet_1).row(row)
            countries.each_with_index do |country, index|              
              next if country.blank?              
              if data[country].blank?
                data[country] = {}
              end
              data[country][fees[0]] = fees[index]
            end
          end

          data
        end
      end
    end
  end
